void GUIDEMO_Treeview(void) {
  GUIDEMO_ShowIntro("Treeview demo",
                    "Shows a hierarchial view of\n"
                    "the files in a directory and\n"
                    "some moving sprites");
  GUIDEMO_ShowInfoWin();
  GUIDEMO_DrawBk(0);
  #if (GUI_SUPPORT_CURSOR | GUI_SUPPORT_TOUCH)
    GUI_CURSOR_Hide();
  #endif
  _DemoTreeview();
  #if (GUI_SUPPORT_CURSOR | GUI_SUPPORT_TOUCH)
  /* Cursor disabled */
  /* GUI_CURSOR_Show(); */
  #endif
  GUIDEMO_NotifyStartNext();
}

